var cardsArray = [
    {    'name': 'CSS',    'img': 'data:image/png;base64,',  },
    {    'name': 'HTML',    'img': 'data:image/png;base64,',  },
    {    'name': 'jQuery',    'img': 'data:image/jpeg;base64,',  },
    {    'name': 'JS',    'img': 'data:image/png;base64,',  },
    {    'name': 'Node',    'img': 'data:image/png;base64,',  },
    {    'name': 'Photo Shop',    'img': 'data:image/jpeg;base64,',  },
    {    'name': 'PHP',    'img': 'data:image/png;base64,',  },
    {    'name': 'Python',    'img': 'data:image/jpeg;base64,',  },
    {    'name': 'Ruby',    'img': 'data:image/jpeg;base64,',  },
    {    'name': 'Sass',    'img': 'data:image/png;base64,',  },
    {    'name': 'Sublime',    'img': 'data:image/jpeg;base64,',  },
    {    'name': 'Wordpress',    'img': 'data:image/jpeg;base64,',  },
  ];

  var gameGrid=cardsArray.concat(cardsArray);
gameGrid.sort(function(){
  return 0.5-Math.random();
})

  var game=document.getElementById('game-board');
  var grid=document.createElement('section');
  grid.setAttribute('class','grid');
  game.appendChild(grid);

  for(var i=0;i<gameGrid.length;i++){
    var card=document.createElement('div');
    card.classList.add('card');
    card.dataset.name=gameGrid[i].name;
    var front=document.createElement('div');
    front.classList.add('front');
    var back=document.createElement('div');
    back.classList.add('back');
    back.style.backgroundImage=`url(${gameGrid[i].img})`;
    grid.appendChild(card);
    card.appendChild(front);
    card.appendChild(back);
 
  }

  var match=function(){
   var selected=document.querySelectorAll('.selected');
   for(var i=0;i<selected.length;i++){
    selected[i].classList.add('match');
   }
  }
function resetGuessess(){
  count=0;
  firstElement='';
  secondElement='';
  previousTarget=null;
  var selected=document.querySelectorAll('.selected');
  for(var i=0;i<selected.length;i++){
    selected[i].classList.remove('selected');
  }
}
var count=0;
var firstElement='';
var secondElement='';
var previousTarget=null;
var delay=1200;
  grid.addEventListener('click',function(event){
    var clicked=event.target;
    if(clicked.nodeName==='SECTION' || clicked===previousTarget  || clicked.parentNode.classList.contains('match')|| clicked.parentNode.classList.contains('selected')){
      return;
    }
    if(count<2){
      count++;
      if(count===1){
       firstElement=clicked.parentNode.dataset.name;
       clicked.parentNode.classList.add('selected');
      }
      else{
        secondElement=clicked.parentNode.dataset.name;
        clicked.parentNode.classList.add('selected');
      }
      if(firstElement!=='' && secondElement!==''){
        if(firstElement===secondElement){
         setTimeout(match,delay);
         setTimeout(resetGuessess,delay);
        }
        else
        setTimeout(resetGuessess,delay);
      }
      previousTarget=clicked;
    }
   
  })
  